import { Link } from "react-router-dom";
import logo from '../logo_white_bg.jpg'; // Import the logo image correctly
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function NavBar() {
    return (
        <>
        <nav className="bg-blackShade">
            <div>
            </div>
            <ul className="flex flex-row justify-center items-center">
                {/* Use the imported logo image */}
                <img className="object-contain h-48 w-96 flex-3" src={logo} alt="Logo" />
                <li className="font-PT_Serif text-3xl text-white text-center flex-1"><Link to="/">Home</Link></li>
                <li className="font-PT_Serif text-3xl text-white text-center flex-1"><Link to="/contact">Contact</Link></li>
                <li className="font-PT_Serif text-3xl text-white text-center flex-1"><Link to="/store">Store</Link></li>
                <li className="font-PT_Serif text-3xl text-white text-center flex-1"><Link to="/cart">Cart</Link></li>
                <FontAwesomeIcon icon="fa-brands fa-instagram" />         
                <FontAwesomeIcon icon={faInstagram} />
             </ul>
        </nav>
        <FontAwesomeIcon icon="fa-brands fa-instagram" />         
        
        </>
    );
}

export default NavBar;
